import './App.css';
import LeftMenu from './Elements/LeftBar/LeftMenu.js';
import TopMenu from './Elements/TopBar/TopMenu.js';
import Content from './Elements/Content/Content.js'

function App() {
  return (
    <div className="App">
      <div className="Top">
        <TopMenu />
      </div>
      <div className="Main">
        <LeftMenu/>
        <Content />
      </div>
    </div>
  );
}

export default App;
